export default function App() {
  return (
    <>
      <Header />
    </>
  );
}

function Header() {
  return (
    <div className="Box">
      <div>
        <h2 className="top-text">New Item</h2>
        <form>
          <input type="text" />
        </form>
      </div>
    </div>
  );
}
